import React from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import App from '../App';


const Router = () => {

    return (
        <BrowserRouter>
            <Switch>
                <Route path="/" component={ App } exact />
                <Route path="/about" component={ About } />
            </Switch>
        </BrowserRouter>
    )
}

export default Router;
